import { AppBar, Toolbar, Typography, styled} from '@mui/material';
import { Menu } from '@mui/icons-material';

const StyledApp = styled(AppBar)`
        background: #fff;
        height: 70px;
`;

const MenuIcon = styled(Menu)`
        color: #000;
`;

const Text= styled(Typography)`
        color: #000;
`

const Header = () => {

    return (
        <StyledApp>
            <Toolbar>
                <MenuIcon />
                <Text>NewX</Text>
            </Toolbar>
        </StyledApp>
    )
}

export default Header;
